import React from 'react';
import Card from"./Card";
import "./styles/Cards.module.css"

const Cards = ({countries}) => {
    return(
        
        <div className="cardContainer">
            {
                countries?.map((e)=>{
                    return(
                    
                        <Card
                            key={e.cca3}
                            id={e.cca3}
                            name={e.name}
                            flags={e.flags}
                            continents={e.continents}
                        />
                    );
                })
            }
        </div>
    )
}
export default Cards;
